	[script]
	id="boss_boast"
		[modification]
		on_process="[
# set(level, 'lock_screen', [level.player.x, level.player.y]) -- not until I can lock Y only # 
transient_speech_dialog(self, [~Ha ha, it's me!~], [~The placeholder kitty!~]),
schedule(1, begin_script('boss_defeat')),
end_script()
]"
		target="me"
		[/modification]

	[/script]

	[script]
	id="boss_defeat"
		[modification]
		on_die="[
set(level, 'lock_screen', null()),
shake_screen(0,800,0,-800),
set(level.player.vars.triggered_events, level.player.vars.triggered_events + ['cave_boss_fight_won']),
transient_speech_dialog(level.player, [~Goodbye!~]),
music_onetime('specialitem.ogg'),
fire_event(get_object(level, 'boss_gate_1'), 'unlock'),
fire_event(get_object(level, 'boss_gate_2'), 'unlock'),
fire_event(get_object(level, 'boss_gate_3'), 'unlock'),
end_script()
]"
		target="me"
		[/modification]

	[/script]

	[script]
	id="entrance_elevator_trip"
		[modification]
		on_process="if(y < 2000, set(y, y + 48), end_script())"
		target="me"
		[/modification]

	[/script]

	[script]
	id="exit_elevator_trip"
		[modification]
		on_process="if(y > -1400, set(y, y - 72), [teleport('grooming-groves.cfg', 'boss_entrance', 'iris'), die(), end_script()])"
		target="me"
		[/modification]

	[/script]

